import styles from "../component/card.css"

function Card(props) {
    let className;
    {(props.boolean=='true')
    ? className = 'regular'
    : className = ''
    }
       return (
    <div>

      <section >
       <div>
       <article className={className}>
           <div>{props.english}</div><div> {props.transcription}</div> <div> {props.russian} {props.tags}</div>
       </article>
       </div>
       </section>
        </div>
    );
}
export default Card
